import React from 'react';

const Header = ({data}) => {
	const rows = data.map((item) => {
		const row = Object.keys(item).map((key) => {
			return <th>{item[key]}</th>;
		});
		return <tr>{row}</tr>;
	});
	return <thead>{rows}</thead>;
};

export default Header;
